class Klant{constructor(t,s){this.naam=t,this.admin=s}}class Mandje{constructor(t){this.klant=t,this.artikelen=[]}}class Artikel{constructor(t,s,i){this.id=t,this.naam=s,this.prijs=i}}class Bericht{constructor(t,s,i,a,n,c){this.date=t,this.time=s,this.klant=i,this.nickname=a,this.titel=n,this.text=c}}export{Klant,Mandje,Artikel,Bericht};